import React from 'react'

 const Orders = () => {
    const navigated=  useNavigate();
    const arrow=()=>{
      navigated('/Home')
    }
    return (
        <div className='don'>
            <div className='pink'>
            
            <button className="oip" onClick={arrow}>&lt;</button>
              <span className='war'>Deliver To</span>
              <img src="./asset/Group (2).png" alt="pi" className=''/>
            </div>
        </div>
    )
}

export default Orders
